// Footer.js

import React from "react";
import "./footer1.css";
import "./footer2.css";

const Footer1 = () => {
  return (
    <footer className="footer1">
      {/* Your Footer1 content */}
    </footer>
  );
};

const Footer2 = () => {
  return (
    <footer className="footer2">
      {/* Your Footer2 content */}
    </footer>
  );
};

const Footer = () => {
  return (
    <>
      <Footer1 />
      <Footer2 />
    </>
  );
};

export default Footer;
